const AddPost = () => {
  return (
    <>
      <h1>add post</h1>
      <div>
        <label>
          Post title: <input name="postTitle" defaultValue="Biking" />
        </label>
      </div>

      <div>
        <label htmlFor="postTextArea">Напишите текст поста</label>
        <textArea id="postTextArea" rows={4} cols={30} />
      </div>
    </>
  );
};

export default AddPost;
